import React, { Component } from "react";
import { Link } from "react-router-dom";

class Main extends Component {
  render() {
    return (
      <div className="App">
        <h1>Project Home</h1>
        {/* Link to List.js */}
        <Link to={"./details"}>
          <button variant="raised">My List</button>
        </Link>
      </div>
    );
  }
}
export default Main;
